import toggle from '../../assets/toggle.png'
import classes from './MainNavigation.module.css';

const MainNavigation = () => {
    return (
        <header className={classes.header}>
            <div className={classes.flex}>
                <a className={classes.toggle} data-bs-toggle="offcanvas" href="#offcanvasExample" role="button" aria-controls="offcanvasExample">
                    <img src={toggle} />
                </a>
                <h3 className={classes.title}>Website Name</h3>
            </div>
            <div className={classes.score}><span></span> Coins</div>
        </header>
    )
}

export default MainNavigation;
